import { Form, Button, Container, Navbar } from 'react-bootstrap';

function NavScrollExample() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#">BRAND NAME</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Form className="d-flex w-100"> {/* Make Form take full width */}
            <Form.Control
              type="search"
              placeholder="Search for Products, Categories and More"
              className="me-3" // Keep margin to the right for the button
              aria-label="Search"
              size="sm"
              style={{ minWidth: '300px', width: '100%' }} // Adjust minimum width if needed
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
